import React, { useState } from 'react'
import Rotator from './components/rotator';
import './App.css';
import logo from './images/logo2.svg'

function App(props) {
  return (
    <>
      <div class="position-absolute top-50 start-50 translate-middle"><img src={logo} className='Rotator'/></div> 
    </>
  );  
}

export default App;
